/*Table structure for table `portfolios` */

DROP TABLE IF EXISTS `portfolios`;

CREATE TABLE `portfolios` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `description` varchar(500) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=latin1;

/*Data for the table `portfolios` */

insert  into `portfolios`(`id`,`description`) values (1,'Pre Operation'),(2,'Post Operation'),(3,'Operation Refinement');


/*Data for the table `posts` */

insert  into `posts`(`id`,`title`,`body`,`created`,`modified`) values (1,'The title','This is the post body.','2013-04-03 06:08:39',NULL),(2,'A title once again','And the post body follows.','2013-04-03 06:08:39',NULL),(3,'Title strikes back','This is really exciting! Not.','2013-04-03 06:08:39',NULL);

/*Table structure for table `sponsee_images` */

DROP TABLE IF EXISTS `sponsee_images`;

CREATE TABLE `sponsee_images` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `sponsee_id` bigint(20) DEFAULT NULL,
  `description` varchar(100) DEFAULT NULL,
  `date_uploaded` datetime DEFAULT NULL,
  `image` blob,
  `content_type` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`)
