insert  into `sponsees`(`id`,`firstname`,`lastname`,`middlename`,`address`,`country`,`maplocation`,`information`,`birthdate`,`primaryimage`) values (48,'Sam','CaÃƒÂ±ete','Villegas','Santa Fe, Bantayan, Cebu','PH','http://wikimapia.org/26179511/Pooc','Sam was born to have a cleft lip and a palate, he lives with his family consisting of his Father and mother, 1 sister in a small island north of Cebu, Philippines.  His father (Anthony CaÃƒÂ±ete) works as a carpenter helper.  The work of the helper is very difficult due to its instability projects and very low pay with 150-200 pesos a day only, and if there are no projects for him its very difficult for the family to eat 3 times a day.\r\n\r\nSam family lives together with his grandmother  and grandfather small house, made of bamboo and local materials.  Their family shares the house with his cousins family as well with  4 adults and 5 children. ','2011-11-24',6),(49,'Rosalie','Rosello','D.','Kinatarkan, Bantayan Island, Cebu','PH','http://wikimapia.org/26179608/Kinatarkan','Rosalie D. Rosello, 12 years old girl born in San Miguel street, Kinatarcan, Sta.fe, Bantayan Island Cebu. Rosalie is the 4th  daughter of fisherman Rolando Almonicar Rosello and his  plain housewife Maria Fe Dabalos Rosello. Mr. Rolando, a 45 years old is a hardworking man, raised his 8 children in a very discipline way. It was from him that Rosalie learned much of her hard work and perseverance. Her mother Maria Fe actually gave birth of 10 children, but unfortunately her two kids passed away. The first one drowned in the ocean while the other one died because of pulmonary. So they are having 8 kids now including Rosalie, 4 girls and 4 boys.\r\n\r\nRosalie, is now a grade 6 student in Kinatarcan elementary School. She is always doing great in her studies that\'s why she has always been an honor student in spite of her circumstances she did not use it as an excuse or an alibi not to go to school. Though life for her is not easy compared to other students, having a cleft lip has given her much difficulties and insecurities but she still pushes forward in the face of many obstacles.\r\n\r\nThrough the Smile Train Program, Rosalie received free  sponsored cleft lip and palate surgery at the skilled hands of Dr. Mirela Mijares and her team at Cebu City Medical Hospital, the partner hospital of Smile Train in Cebu, Philippines. Under the Smile Train Program, the Cleft patient undergoes as many surgical procedures as he/she needs FOR FREE. All the medications, laboratory exams, medical supplies, hospitalization costs are shouldered by Smile Train except for the incidental expenses for the food and transportation fees, on which WE as part of the  Abounding In Love comes in to help those family who can\'t afford for the transportation, food and a place to stay in the city. Especially to those family who lives in the mountain villages and in the island like Rosalie\'s family.','2001-02-05',3),(52,'Zyriel','Nepangue','Deo','Maricaban, Bantayan Island, Cebu','PH','http://wikimapia.org/20475614/Brgy-Maricaban','Baby Zyriel was also born to have a cleft palate on April 10, 2013. She\'s also born in the northern part of Cebu, in Bantayan Island. Her father\'s named is Ricjun Nepangue who doesn\'t have a permanent job, he sometimes worked as a carpenter\'s helper depending only on the projects. Her mother Maribeth Deo is just plain housewife, she only gave birth to baby Zyriel. Currently, they are living together with her grandma\'s(father side) cousin house since they cannot afford to build their own house. Their  parents are not yet married as of now because her father  was under aged when her mother got pregnant of her.','2013-04-10',9);

