/*Table structure for table `sponsee_listing` */

DROP TABLE IF EXISTS `sponsee_listing`;

/*!50001 DROP VIEW IF EXISTS `sponsee_listing` */;
/*!50001 DROP TABLE IF EXISTS `sponsee_listing` */;

/*!50001 CREATE TABLE `sponsee_listing` (
  `id` bigint(20) NOT NULL DEFAULT '0',
  `firstname` varchar(100) DEFAULT NULL,
  `lastname` varchar(100) DEFAULT NULL,
  `middlename` varchar(100) DEFAULT NULL,
  `address` varchar(255) DEFAULT NULL,
  `country` varchar(10) DEFAULT NULL,
  `maplocation` varchar(500) DEFAULT NULL,
  `information` text,
  `birthdate` date DEFAULT NULL,
  `primaryimage` bigint(20) DEFAULT NULL,
  `total_neededamount` decimal(32,2) DEFAULT NULL,
  `total_donatedamount` decimal(32,2) DEFAULT NULL,
  `percentage` decimal(41,6) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1 */;

/*View structure for view sponsee_listing */

/*!50001 DROP TABLE IF EXISTS `sponsee_listing` */;
/*!50001 DROP VIEW IF EXISTS `sponsee_listing` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `sponsee_listing` AS select `s`.`id` AS `id`,`s`.`firstname` AS `firstname`,`s`.`lastname` AS `lastname`,`s`.`middlename` AS `middlename`,`s`.`address` AS `address`,`s`.`country` AS `country`,`s`.`maplocation` AS `maplocation`,`s`.`information` AS `information`,`s`.`birthdate` AS `birthdate`,`s`.`primaryimage` AS `primaryimage`,sum(coalesce(`sn`.`neededamount`,0)) AS `total_neededamount`,sum(coalesce(`sn`.`donatedamount`,0)) AS `total_donatedamount`,coalesce(((sum(coalesce(`sn`.`donatedamount`,0)) / sum(coalesce(`sn`.`neededamount`,0))) * 100),0) AS `percentage` from (`sponsees` `s` left join `sponsee_needs` `sn` on((`sn`.`sponsee_id` = `s`.`id`))) group by `s`.`id` */;

